rido, la cual en comunicacion telefonica con el Comisario Molina Ricardo, director de Escuela Juan Vucetich sede Mar del Plata anoticiandolo del ilicito sufrido por la dicente<br>             <b>Modalidad:</b> <span style="color: darkred; font-weight: bold;">ASALTO, MOTOCHORRO, MOTO(ROBO/HURTO)</span><br>             <b>Lugar:</b>  RUTA 226 KM 110 nan         </div>         </div>`)[0];
